import './Orgaos.css';

function Orgaos(){
    return(
        <div className='orgaos-section'>
            <h2 className="info-text">Critérios para seleção das marcas</h2>
            <p className='subinfo'>Confira os parâmetros para nossa lista das melhores marcas de colchões</p>
        </div>
    );
}

